import logo from './img/logo.png';
import textlogo from './img/text.png';
import './App.css';
import React from 'react';

class App extends React.Component {
  constructor() {
    super();
    this.state = {date: new Date()};
  }

  componentDidMount() {
    this.interval = setInterval(() => this.setState({ date: new Date() }), 6000);
  }

  render() {

    return (
      <div className="parent">
        <div className="entry">
          <div className="bar">
            <div className="logodiv">
              <img className="logo" src={logo}/>
              <div className="link">Email</div>
              <div className="link">LinkedIn</div>
              <div className="link">Github</div>
            </div>
            <div>
              <span className="date">{this.state.date.getMonth()+1}/{this.state.date.getDate()}/{this.state.date.getYear()+1900}</span>
              <span className="time">
              {this.state.date.getHours() > 12 ? this.state.date.getHours() - 12 : this.state.date.getHours()}:{String(this.state.date.getMinutes()).length < 2 ? `0${String(this.state.date.getMinutes())}` : String(this.state.date.getMinutes())} {this.state.date.getHours() > 12 ? "PM" : "AM"}
              </span>
            </div>
          </div>
          <div className="about">
            <div className="text-div">
              <img className="text" src={textlogo}/>
            </div>
            <div className="name">ABOUTME.txt</div>
          </div>
          <div className="about">
            <div className="text-div">
              <img className="text" src={folder2}/>
            </div>
            <div className="name">ABOUTME.txt</div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
